import React from 'react';
import style from './starry.jpg';
import contents from './mountains.jpeg';
import output from './output.png';

const img = {
  width: '450px', 
  height: '450px' 
}


const NSTExample = () => {
  return (
    <div className='dib flex-wrap'>
      <img className='ma4  center dib' style={ img } src={contents} alt='' />
      <figcaption>Take your favourite picture</figcaption>
      <img className='ma4  center dib' style={ img } src={style} alt='' />
      <figcaption>Then grab a picture that reflects your favourite artists style</figcaption>
      <img className='ma4  center dib' style={ img } src={output} alt='' />
      <figcaption>We will run your images through a Neural Style Transfer deep learning model. Which will produce a result like this.</figcaption>
    </div>
  );
}

export default NSTExample
